(317, 1, '2020-08-02 16:12:15', '2020-08-02 16:12:15', '<p>1 untuk mewujudkan <b>mimpi</b> anda, satu atau semuanya.</p>		\n			<h4>Visi Kami</h4>		\n				<h3>\n					Mewujudkan ruang kerja efisien\n				</h3>\n				<h3>\n					Mewujudkan ruang kerja efektif\n				</h3>\n				<h3>\n					Tiada ketiadaan\n				</h3>\n				<h3>\n					Gerak cepat ke depan\n				</h3>\n			<h5>Dengan 1 misi,</h5>		\n			<h2>Meniadakan<br>Ketiadaan</h2>		\n										<img width=\"200\" height=\"300\" src=\"http://localhost/wordpress/wp-content/uploads/2020/08/pexels-rakicevic-nenad-1274260-200x300.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/08/pexels-rakicevic-nenad-1274260-200x300.jpg 200w, http://localhost/wordpress/wp-content/uploads/2020/08/pexels-rakicevic-nenad-1274260-683x1024.jpg 683w, http://localhost/wordpress/wp-content/uploads/2020/08/pexels-rakicevic-nenad-1274260-768x1152.jpg 768w, http://localhost/wordpress/wp-content/uploads/2020/08/pexels-rakicevic-nenad-1274260-1024x1536.jpg 1024w, http://localhost/wordpress/wp-content/uploads/2020/08/pexels-rakicevic-nenad-1274260-1365x2048.jpg 1365w, http://localhost/wordpress/wp-content/uploads/2020/08/pexels-rakicevic-nenad-1274260-scaled.jpg 1707w\" sizes=\"(max-width: 200px) 100vw, 200px\" />											\n				<h4>\n				</h4>\n								<p>Dikenal Sejak Abad Ke-5</p>\n		Dimulai dari perusahaan militer, kami memiliki ide untuk mengembangkan blueprint yang kami miliki lebih jauh. Dua tahun setelahnya, 1 menjadi tempat berkumpul artisan-artisan dari seluruh penjuru, menghasilkan karya-karya menakjubkan.\n&nbsp;\n<p>Sekarang 1 dikenal sebagai ruang sinergis artisan dan ideawan.</p>', 'Tentang 1', '', 'publish', 'closed', 'closed', '', 'tentang-1', '', '', '2020-08-04 07:42:13', '2020-08-04 07:42:13', '', 0, 'http://localhost/wordpress/?page_id=317', 0, 'page', '', 0),
