(319, 1, '2020-08-02 16:12:51', '2020-08-02 16:12:51', '<h4>Artisan Terbaik Kami</h4>\n<h5>Siap aktuasi ide anda.</h5>\n<figure><img src=\"http://localhost/wordpress/wp-content/uploads/2020/08/groomsman3.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/08/groomsman3.jpg 234w, http://localhost/wordpress/wp-content/uploads/2020/08/groomsman3-150x150.jpg 150w\" sizes=\"(max-width: 234px) 100vw, 234px\" width=\"234\" height=\"234\"></figure>\n<h3>Ben Clay</h3>\nsaya pro\n<figure><img src=\"http://localhost/wordpress/wp-content/uploads/2020/08/team_4.jpg\" alt=\"\" width=\"268\" height=\"275\"></figure>\n<h3>August Ellis</h3>\napapun, pasti jadi\n<figure><img src=\"http://localhost/wordpress/wp-content/uploads/2020/08/pexels-khamla-douangchandeng-4508902-scaled.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/08/pexels-khamla-douangchandeng-4508902-scaled.jpg 1707w, http://localhost/wordpress/wp-content/uploads/2020/08/pexels-khamla-douangchandeng-4508902-200x300.jpg 200w, http://localhost/wordpress/wp-content/uploads/2020/08/pexels-khamla-douangchandeng-4508902-683x1024.jpg 683w, http://localhost/wordpress/wp-content/uploads/2020/08/pexels-khamla-douangchandeng-4508902-768x1152.jpg 768w, http://localhost/wordpress/wp-content/uploads/2020/08/pexels-khamla-douangchandeng-4508902-1024x1536.jpg 1024w, http://localhost/wordpress/wp-content/uploads/2020/08/pexels-khamla-douangchandeng-4508902-1365x2048.jpg 1365w\" sizes=\"(max-width: 1707px) 100vw, 1707px\" width=\"1707\" height=\"2560\"></figure>\n<h3>Ronald Ortiz</h3>\nhanya kesempurnaan\n<figure><img src=\"http://localhost/wordpress/wp-content/uploads/2020/08/pexels-luis-araujo-3656518-scaled.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/08/pexels-luis-araujo-3656518-scaled.jpg 1707w, http://localhost/wordpress/wp-content/uploads/2020/08/pexels-luis-araujo-3656518-200x300.jpg 200w, http://localhost/wordpress/wp-content/uploads/2020/08/pexels-l