(439, 1, '2020-08-04 10:32:46', '2020-08-04 10:32:46', '<!-- wp:paragraph -->\n<p>On [date], an Executive Order was issued directing all [state] residents to stay at home or at their place of residence and mandating the closing of all nonessential businesses.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>[Company name] falls within the definition of essential business [or supplier of an essential business] as defined in the Executive Order, and we will remain open during this time. Employees are expected to continue to report to work as scheduled. A <a href=\"https://www.shrm.org/ResourcesAndTools/tools-and-samples/hr-forms/Pages/COVID-19-Essential-Employee-Authorization-to-Travel.aspx\">letter </a>is attached that should be kept with you when commuting to and from work should your compliance with the stay-at-home order be questioned. You should also be prepared to present your [company name] identification badge.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you have any questions, please contact [name] at [contact information].</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Sincerely,</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1 melihat bahwa dengan adanya COVID-19 yang terus berkembang di seluruh dunia, tidak dapat dihindari bahwa ini merupakan waktu-waktu yang sulit, dan penuh ketidakpastian. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pada tanggal 4 Agustus 2020, eksekutif 1 telah mengisukan kepada seluruh pekerja untuk mengambil pekerjaan sebisa mungkin dari rumah. Akses ke gedung kami batasi dengan syarat tertentu, jika perlu hubungi kami di <a href=\"http://localhost/wordpress/contact/\" target=\"_blank\" rel=\"noreferrer noopener\">sini</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pertanyaan-pertanyaan yang ada dapat diajukan di kolom komentar, atau hubungi kami langsung melalui <a rel=\"noreferrer noopener\" href=\"http://localhost/wordpress/contact/\" target=\"_blank\">kontak yang ada</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Terima kasih.</p>\n<!-- /wp:paragraph -->', 'Pemberitahuan Keputusan 1 Mengenai COVID-19', '', 'inherit', 'closed', 'closed', '', '436-revision-v1', '', '', '2020-08-04 10:32:46', '2020-08-04 10:32:46', '', 436, 'http://localhost/wordpress/2020/08/04/436-revision-v1/', 0, 'revision', '', 0),
